import React from 'react';

const Contact = () => {
  return (
<section class="py-5">
	<div class="container">
		<div class="row">
			<div class="col-lg-6">
				<h2 class="display-5 fw-bold">Request a Callback</h2>
				<form class="d-flex pt-4 me-lg-5">
					<input aria-label="input" class="form-control me-2" placeholder="Telephone Number" type="tel"/> <button class="btn btn-primary text-nowrap" type="submit">Call Me</button>
				</form>
			</div>
			<div class="col-lg-6 mt-4 mt-lg-0">
				<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam feugiat erat quis pulvinar semper. Cras commodo vitae libero ut consequat.</p>
				<div class="d-lg-flex text-primary mt-3 mt-lg-5">
					<a class="text-decoration-none me-4 fs-5 fw-bold" href="tel:+1(234)%20567-89-01">+1(234) 567-89-10</a> <a class="text-decoration-none fs-5 fw-bold" href="mailto:info@collector.com">hello@yourdomain.com</a>
				</div>
			</div>
		</div>
	</div>
</section>
  );
};

export default Contact;
